import React, { Component } from 'react'

export default class ListScrapPostComponent extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
            ScrapPost:[]
            
        }
    
        this.handleEvent = this.handleEvent.bind(this)
    }
    
  render() {
    return (
        
      <div>
          <h2>ListScrapPostComponent</h2>
          <div className='row'>
              <table className='table table-stripped table-bordered'>
                  <thead><tr>
                      <th>User Name</th>
                      <th>Material</th>
                      <th>City</th>
                      <th>Uploading Date</th>
                      <th>Scrap Image</th>
                      </tr>
                      </thead>
          <tbody>
              {this.state.ScrapPost.map}
              ScrapPost=>
              <tr key={ScrapPost.id}>
                  <td>
                      {ScrapPost.user}
                      {ScrapPost.material}
                      {ScrapPost.city}
                      {ScrapPost.weight}
                      {ScrapPost.uploadingDate}
                      {ScrapPost.scrapImage}

                  </td>
              </tr>
          </tbody>
          </table>
          </div>
          </div>

    )
  }

}
